css:
.deprecation-cop {
  overflow: auto;
  -webkit-flex: 1;
  background-color: #cccccc !important;
}
.deprecation-cop .deprecation-info {
  padding: 0 10px;
}
.deprecation-cop .deprecation-info:hover {
  background-color: #6aa5e9 !important;
}
.deprecation-cop .collapsed > ul {
  display: none;
}
.deprecation-cop .list {
  list-style-type: none;
  padding: 0;
}
.deprecation-cop .stack-trace {
  background-color: #f4f4f4;
  padding: 10px;
  margin-bottom: 10px;
}
.deprecation-cop a {
  color: #000000;
}
